export function getPrices (origin, destination, plan, time) {
  if (origin === '011' && '016') {
    return {
      withoutPlan: time * 1.9,
      withPlan: time * 1.9, 
    }
  } else if (origin === '011' && '017') {
    return {
      withoutPlan: time * 1.7,
      withPlan: time * 1.7, 
    }
  } else if (origin === '011' && '018') {
    return {
      withoutPlan: time * 0.9,
      withPlan: time * 0.9, 
    }
  } else if (origin === '016' && '011') {
    return {
      withoutPlan: time * 2.9,
      withPlan: time * 2.9, 
    }
  } else if (origin === '017' && '011') {
    return {
      withoutPlan: time * 2.7,
      withPlan: time * 2.7, 
    }
  } else if (origin === '018' && '011') {
    return {
      withoutPlan: time * 1.9,
      withPlan: time * 1.9, 
    }
  }
}
